def restore_ip_addresses(s):
    def backtrack(start, path, ip_sum):
        if len(path) == 4:
            if start == len(s):
                result.append('.'.join(map(str, path)))
            return
        for end in range(start + 1, min(start + 4, len(s))):
            if int(s[start:end]) <= 255 and (start > 0 or s[start] != '0'):
                backtrack(end, path + [int(s[start:end])], ip_sum + [int(s[start:end])])
    result = []
    backtrack(0, [], [])
    return result
